import { useState , useEffect } from 'react';
import Axios from 'axios'
import './Header.css';
const Header = () => {
  const Submit = () =>{
    alert('Thank you');
  }
  const [email,setlogin] = useState('');
  const [password,setpassword] = useState('');

  const SubmitLogin = () =>{
    Axios.post('http://localhost:3001/insert',{
      email:email,
      password:password
  }).then((Response) =>{
    console.log(Response);
  });
  };
  return (
    <header className="Project">
       <nav className='Navbar'>
            <ul>
                <a href="#Container"><li>home</li></a>
                <a href="#Footer"><li>Contact Us</li></a>
                <a target="_blank" href={process.env.PUBLIC_URL + "/Client/src/form.html"} ><li>Services</li></a>
                <a href="#"><li>Payment</li></a>
                <a href="#"><li>Book</li></a>
                <button>Order</button>
            </ul>
        </nav>
      <div className='Container' id='Container'>
       
        <center className = "Center">
            <h1>Best 
              <span className='Color'> Shipping</span>
            </h1>
        </center>
        </div>
        <footer>
    <div id="Footer">
        <div className="column reveal">
          <h1 className="Head">Contact Details</h1>
            <div className="column-firt">
            <h1 className='first'><i className="fas fa-phone"></i>9944669700</h1>
            <h1><i className="fas fa-envelope"></i>ijaasahamad2003@gmail.com</h1>
            </div>
            <div className="column-second">
                <form action="get" method="post">
                  <h1>Details</h1>
                   <div className="input"> 
                      <input type="email" name="email" placeholder="Enter your Email" onChange={(e)=>{
                          setlogin(e.target.value)
                      }} required/>
                   </div>
                   <div className="input">
                      <input type="text" name="password" placeholder="Enter your Number"
                            onChange={(e) =>{
                                setpassword(e.target.value);
                            }}
                            required
                      />
                   </div>
                   <div className="input">
                          <textarea cols={25} rows={5} placeholder="Enter your message" required></textarea>
                   </div>
                   <button type='submit' onClick={SubmitLogin}>Submit</button>
                </form>
            </div>
        </div>
    </div>
    </footer>
    <services id="Services">
        
    </services>
    </header>
  )
}

export default Header;
